    private AbstractMysqlBinlogReaderImpl mysqlBinlogReader;
    private Connection connection;
    

    @Before
    public void init() throws IOException {
        
        connection = Mockito.mock(Connection.class);
        
        mysqlBinlogReader = Mockito.mock(AbstractMysqlBinlogReaderImpl.class);
        Mockito.when(mysqlBinlogReader.initializeConnection()).thenReturn(connection);
        Mockito.doCallRealMethod().when(mysqlBinlogReader).initialize();
        Mockito.doCallRealMethod().when(mysqlBinlogReader).connect();
        Mockito.doCallRealMethod().when(mysqlBinlogReader).receiveSettings();
        Mockito.doCallRealMethod().when(mysqlBinlogReader).bindSettings();
        Mockito.doCallRealMethod().when(mysqlBinlogReader).readMetaData();
        Mockito.doCallRealMethod().when(mysqlBinlogReader).readCurrentBinlogPosition();
        Mockito.doCallRealMethod().when(mysqlBinlogReader).dumpBinglog();
        Mockito.doCallRealMethod().when(mysqlBinlogReader).readBinlogEvent();
        Mockito.doCallRealMethod().when(mysqlBinlogReader).getBinlogDeserializerContext();
        Mockito.doCallRealMethod().when(mysqlBinlogReader).getEventPosition();
    }

    @Test
    public void minBinlogreaderTest() {

        RawMysqlPacket packets[] = new RawMysqlPacket[hex.length-1];
        RawMysqlPacket packet = new RawMysqlPacket(hex[0].length()/2, 1, DatatypeConverter.parseHexBinary(hex[0]));
        
        for (int i = 1; i < hex.length; i++) {
            packets[i - 1] = new RawMysqlPacket(hex[i].length()/2, ((i + 1) & 0xFF), DatatypeConverter.parseHexBinary(hex[i]));
        }
        Mockito.when(connection.readRawPacket()).thenReturn(packet, packets);

        mysqlBinlogReader.initialize();
        mysqlBinlogReader.connect();
        mysqlBinlogReader.receiveSettings();
        
        mysqlBinlogReader.bindSettings();
        BinlogDeserializerContext binlogDeserializerContext = mysqlBinlogReader.getBinlogDeserializerContext();
        assertEquals(MysqlChecksum.MysqlChecksumType.CRC32, binlogDeserializerContext.getChecksum().getType()); 
        
        mysqlBinlogReader.readMetaData();

        mysqlBinlogReader.readCurrentBinlogPosition();
        EventPosition eventPosition = mysqlBinlogReader.getEventPosition();
        assertEquals(eventPositionFileName, eventPosition.getBinlogFileName());
        assertEquals(eventPositionPosition, eventPosition.getPosition());
                
        mysqlBinlogReader.dumpBinglog();

        BinlogEvent binlogEvent = mysqlBinlogReader.readBinlogEvent();
        assertTrue(binlogEvent instanceof FormatDescriptionEvent);
        FormatDescriptionEvent formatDescriptionEvent = (FormatDescriptionEvent) binlogEvent;
        assertEquals(formatDescriptionEventServerVersion, formatDescriptionEvent.getServerVersion());
    }
    
